objectExample.put("a", 5L);
objectExample.put("b", true);

docData.put("objectExample", objectExample);
```

reference_contexts:
['Q: Firestore에서 데이터를 가져오는 방법은 무엇인가요?
A: Firestore에서 데이터를 가져오는 방법은 다음과 같은 코드를 사용할 수 있습니다:

```javascript
await db.collection("users").get().then((event) => {
    for (var doc in event.docs) {
        print("${doc.id} => ${doc.data()}");
    }
});
```']

reference:
Firestore에서 users 콜렉션의 모든 users 정보를 가져오려면 다음과 같은 코드를 사용할 수 있습니다:

```javascript
await db.collection("users").get().then((event) => {
    for (var doc in event.docs) {
        print("${doc.id} => ${doc.data()}");
    }
});
```
